response.about:
Я занимаюсь продвижением в социальных сетях. Своим будущим клиентам могу предложить:
- ведение сообщества (анализ контента, составление контент-плана, написание постов, подбор визуала);
- таргетированная реклама (настройка рекламной кампании, отслеживание и анализ работающих объявлений, написание текста и подбор визуала для объявлений, предоставление отчета);
- комьюнити менеджер (общение с клиентами через социальные сети, отслеживание и ответы на комментарии);
- упаковка и оформление сообщества (аудит визуальной и информационной составляющих сообщества, по необходимости создание новых обложек и логотипа).
